const List = {
    Person : [
        {label:'Person dashboard' , path: 'pers'},
        {label:'View event' , path:'/event'},
        {label:'view respond', path:'/event'},
        {label:'post event',path:'/event'}
    ],

    Admin :[
        {label:'Admin Dashbod' ,  path: 'admin'},
        {label:'Add user' , path: 'add'},
        {label:'manage event',path:'admin'},
        {label:'Generate report',path:'admin'},
        {label:'View event',path:'event'},
        {label:'Setting',path:'admin'}
    ],

    Response_Officer:[
        {label:'Officer Dashboad',path:'officer'},
        {label:'View event',path:'event'},
        {label:'View location',path:'event'},
        {label:'Sent response',path:'office'}
    ],

    Sheha :[
        {label:'Sheha Dashboad',path:'sheha'},
        {label:'View event'}
    ]
}

export default List;
